  const context = useContext(noteContext);
  const { state,addno } = context;

  return (
    <>
    <AddNotes/>
    <div className="row my-3">
      {state.map((note) => {
        // return <div key={note.id}>{note.title}</div>
        // return note.title;
       return <Noteitem key={note._id} note={note}/>
      })}
    </div>
    </>
  );
}
